"""
Lesson 33
Button Element - Simulated Buttons

Exercise 1
Make the Play and Stop portion of a Media Player... this time with no button animation

Instructions:
You have been given artwork assets by the artists in your team. The assets are 2 buttons, a play and a stop button.

Your task is to use these images in a window to implement the play and stop portion of the media player.

This is the same exercise as Lesson 31... the team has decided that it would look better if the button did not animate. One way of achieving this is to use Image elements instead of Button element. Change your previous code to use Image elements.

Make a window with 2 Imave elements
Use the provided Base64 encoded images
The artwork is larger than needed in this portion of the project, use your Image Element to reduce the image size shown to the user to be 1/3 the original size
The images should blend completely into the background (they should appear round only)
When each "button" is clicked, show a popup indicating what would happen in the program when complete (e.g. "Starting Playback")
"""
import PySimpleGUI as sg


def main():
    layout = [[sg.Text('Media Player')],
              [sg.Image(data=play_image, enable_events=True, metadata=False, key='-PLAY-'),
              sg.Image(data=stop_image, enable_events=True, metadata=False, key='-STOP-')]
              # Write your Button Elements
              ]

    window = sg.Window('Media Player', layout)

    while True:
        event, values = window.read()
        if event == sg.WIN_CLOSED:
            break
        if event == '-PLAY-':
            sg.Popup('Starting Playback')
        if event == '-STOP-':
            sg.Popup('Stopping Playback')

    # add your event processing here....

    window.close()


if __name__ == '__main__':
    # these are the Base64 encoded buttons for your use provided by the artists on your team
    play_image = b''
    stop_image = b''

    main()
